import React, { useState } from 'react';
import axios from 'axios';

function UserEntry() {
  const [formData, setFormData] = useState({
    fullName: '',
    dob: '',
    address: '',
    phoneNumber: '',
    emailAddress: '',
    employmentDetails: '',
    bankingInformation: '',
    creditHistory: '',
    assetsLiabilities: '',
    maritalStatus: '',
    uniqueNumber: '',
    document: null,
    amount: '',
    receiveDate: ''
  });

  const handleChange = e => {
    if (e.target.name === 'document') {
      setFormData({ ...formData, [e.target.name]: e.target.files[0] }); 
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const formDataToSend = new FormData();
      formDataToSend.append('fullName', formData.fullName);
      formDataToSend.append('dob', formData.dob);
      formDataToSend.append('address', formData.address);
      formDataToSend.append('phoneNumber', formData.phoneNumber);
      formDataToSend.append('emailAddress', formData.emailAddress);
      formDataToSend.append('employmentDetails', formData.employmentDetails);
      formDataToSend.append('bankingInformation', formData.bankingInformation);
      formDataToSend.append('creditHistory', formData.creditHistory);
      formDataToSend.append('assetsLiabilities', formData.assetsLiabilities);
      formDataToSend.append('maritalStatus', formData.maritalStatus);
      formDataToSend.append('uniqueNumber', formData.uniqueNumber);
      formDataToSend.append('document', formData.document);
      formDataToSend.append('amount', formData.amount);
      formDataToSend.append('receiveDate', formData.receiveDate);

      const res = await axios.post('http://localhost:3005/users', formDataToSend, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      console.log(res.data);
      setFormData({
        fullName: '',
        dob: '',
        address: '',
        phoneNumber: '',
        emailAddress: '',
        employmentDetails: '',
        bankingInformation: '',
        creditHistory: '',
        assetsLiabilities: '',
        maritalStatus: '',
        uniqueNumber: '',
        document: '',
        amount: '',
        receiveDate: ''
      });
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={handleSubmit} className='Type-Form'>
      <div className='Main-InputFlied'>
        <div className='Personal-Info'>
          {/* Labels and inputs for personal information */}
        </div>
      
        <div className='Employment-Info'>
          {/* Labels and inputs for employment information */}
          
          <label htmlFor="amount">Amount:</label>
          <input type="text" name="amount" placeholder="Amount" value={formData.amount} onChange={handleChange} />

          <label htmlFor="receiveDate">Receive Date:</label>
          <input type="date" name="receiveDate" value={formData.receiveDate} onChange={handleChange} />

          <label htmlFor="document">Document:</label>
          <input type="file" name="document" onChange={handleChange} />
        </div>
      </div>

      <div className='Main-Button'>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
}

export default UserEntry;
